ttps://www.fsbwa.com","https://www.fsbwa.com","https://www.fsbwa.com","https://www.fsbwa.com","https://www.fsbwa.com","https://www.fsbwa.com","https://www.fsbwa.com","https://www.fsbwa.com","https://www.frontdoorhome.com","https://www.gambling.com/corporate","https://www.goldenent.com","https://www.greatelmgroup.com"],"shape":[139],"dtype":"object","order":"little"}],["description",{"type":"ndarray","array":["Canterbury Park Holding Corporation, through its subsidiaries, engages in horse racing, card casino, food and beverage, and real estate development businesses. The company's Horse Racing segment operates year-round simulcasting of horse races, as well as wagering on live thoroughbred and quarter horse races on a seasonal basis. Its Card Casino segment offers unbanked card games, such as poker and table games. The company's Food and Beverage segment operates concession stands, restaurants and buffets, bars, and other food venues, as well as caf\u00e9 style restaurants and full-service bars within the Card Casino and simulcast area. This segment also provides lounge services along with a buffet restaurant; various concession style food and beverages during live racing; and catering and events services. Its Development segment engages in various development opportunities, such as residential development, office, restaurants, hotel, entertainment, and retail operations. The company is also involved in the provision of related services and activities, such as parking, advertising signage, publication sales, and other entertainment events and activities. Canterbury Park Holding Corporation was founded in 1994 and is based in Shakopee, Minnesota.","Deere &amp; Company manufactures and distributes various equipment worldwide. The company operates through four segments: Production and Precision Agriculture, Small Agriculture and Turf, Construction and Forestry, and Financial Services. The Production and Precision Agriculture segment provides mid-size tractors, combines, cotton pickers and strippers, sugarcane harvesters, harvesting front-end equipment, sugarcane loaders, pull-behind scrapers, and tillage and seeding equipment, as well as application equipment, including sprayers and nutrient management, and soil preparation machinery for grain growers. The Small Agriculture and Turf segment offers utility tractors, and related loaders and attachments; turf and utility equipment, including riding lawn equipment, commercial mowing equipment, golf course equipment, and utility vehicles, as well as implements for mowing, tilling, snow and debris handling, aerating, residential, commercial, golf, and sports turf care applications; other outdoor power products; and hay and forage equipment. This segment also resells products from other manufacturers. It serves dairy and livestock producers, crop producers, and turf and utility customers. The Construction and Forestry segment provides a range of backhoe loaders, crawler dozers and loaders, four-wheel-drive loaders, excavators, motor graders, articulated dump trucks, landscape and skid-steer loaders, milling machines, pavers, compactors, rollers, crushers, screens, asphalt plants, log skidders, log feller bunchers, log loaders and forwarders, log harvesters, and attachments; and roadbuilding equipment. The Financial Services segment finances sales and leases agriculture and turf, and construction and forestry equipment. It also offers wholesale financing to dealers of the foregoing equipment; and extended equipment warranties, as well as finances retail revolving charge accounts. Deere &amp; Company was founded in 1837 and is headquartered in Moline, Illinois.","Franklin Electric Co., Inc., together with its subsidiaries, designs, manufactures, and distributes water and fuel pumping systems worldwide. It operates through three segments: Water Systems, Fueling Systems, and Distribution. The Water Systems segment offers submersible motors, pumps, drives, electronic controls, water treatment systems, monitoring devices, and related parts and equipment. Its motors and pumps are used principally for pumping clean water and wastewater in various residential, agricultural, municipal, and industrial applications; and manufactures electronic drives and controls that are used in motors for controlling functionality, as well as provides protection from various hazards, such as electrical surges, over-heating, and dry wells or tanks. The Fueling Systems segment provides pumps, pipes, sumps, fittings, vapor recovery components, electronic controls, monitoring devices, and related parts and equipment primarily for use in fueling system applications. This segment serves other energy markets, such as power reliability systems, as well as includes electronic devices for online monitoring of the power utility, hydroelectric, and telecommunication and data center infrastructure. The Distribution segment sells to and provides presale support and specifications to the installing contractors. It sells products produced by the Water Systems segment. The company sells its products to wholesale and retail distributors, specialty distributors, original equipment manufacturers, industrial and petroleum equipment distributors, and oil and utility companies through its employee sales force and independent manufacturing representatives. Franklin Electric Co., Inc. was founded in 1944 and is headquartered in Fort Wayne, Indiana.","Enstar Group Limited acquires and manages insurance and reinsurance companies, and portfolios of insurance and reinsurance business in run-off. It engages in the run-off property and casualty, and other non-life lines insurance businesses. The company also provides consulting services, including claims inspection, claims validation, reinsurance asset collection, syndicate management, and IT consulting services to the insurance and reinsurance industry. It operates in Bermuda, the United States, the United Kingdom, Australia, and other Continental European countries. The company was formerly known as Castlewood Holdings Limited and changed its name to Enstar Group Limited in January 2007. The company was founded in 1993 and is headquartered in Hamilton, Bermuda.","First Mid Bancshares, Inc., a financial holding company, provides community banking products and services to commercial, retail, and agricultural customers in the United States. It accepts various deposit products, such as demand deposits, savings accounts, money market deposits, and time deposits. The company's loan products include commercial real estate, commercial and industrial, agricultural and agricultural real estate, residential real estate, and consumer loans; and other loans comprising loans to municipalities to support community projects, such as infrastructure improvements or equipment purchases. It also offers wealth management services, which include estate planning, investment, and farm management and brokerage services for individuals; and employee benefit services for business enterprises. In addition, the company provides property and casualty, senior insurance products, and group medical insurance for businesses; and personal lines insurance to individuals. It operates through a network of 52 banking centers in Illinois and 14 offices in Missouri, as well as a loan production office in Indiana. The company was formerly known as First Mid-Illinois Bancshares, Inc. and changed its name to First Mid Bancshares, Inc. in April 2019. First Mid Bancshares, Inc. was founded in 1865 and is headquartered in Mattoon, Illinois.","ECB Bancorp, Inc. focuses on operating as a holding company for Everett Co-operative Bank that provides various banking products and services. The company accepts various deposit products, including certificate of deposit accounts, IRAs, money market accounts, savings accounts, demand deposit accounts, and interest-bearing and noninterest-bearing checking accounts. It also offers one- to four-family residential real estate, commercial real estate and multifamily real estate, construction and land, commercial, and consumer loans, as well as home equity loans and lines of credit. In addition, the company invests in securities, consisting primarily of U.S. government and federal agency obligations, mortgage-backed securities, and corporate bonds. It operates through two full-service banking offices located in Everett, Massachusetts and Lynnfield, Massachusetts. The company was founded in 1890 and is based in Everett, Massachusetts.","Paychex, Inc. provides integrated human capital management solutions for human resources (HR), payroll, benefits, and insurance services for small to medium-sized businesses in the United States, Europe, and India. It offers payroll processing services; payroll tax administration services; employee payment services; and regulatory compliance services, such as new-hire reporting and garnishment processing. The company also provides HR solutions, including payroll, employer compliance, HR and employee benefits administration, risk management outsourcing, and the on-site availability of a professionally trained HR representative; and retirement services administration, including plan implementation, ongoing compliance with government regulations, employee and employer reporting, participant and employer online access, electronic funds transfer, and other administrative services. In addition, it offers cloud-based HR administration software products for employee benefits management and administration, time and attendance, digital communication solutions, recruiting, and onboarding solutions; plan administration outsourcing and state unemployment insurance services; various business services to small to medium-sized businesses comprising payroll funding and outsourcing services, which include payroll processing, invoicing, and tax preparation; and payment processing services, financial fitness programs, and a small-business loan resource center. Further, the company provides insurance services for property and casualty coverage, such as workers' compensation, business-owner policies, cyber security protection, and commercial auto, as well as health and benefits coverage, including health, dental, vision, and life. It markets and sells its services primarily through its direct sales force. The company was founded in 1971 and is headquartered in Rochester, New York.","Sysco Corporation, through its subsidiaries, engages in the marketing and distribution of various food and related products primarily to the foodservice or food-away-from-home industry in the United States, Canada, the United Kingdom, France, and internationally. It operates through U.S. Foodservice Operations, International Foodservice Operations, SYGMA, and Other segments. The company distributes frozen foods, such as meats, seafood, fully prepared entr\u00e9es, fruits, vegetables, and desserts; canned and dry foods; fresh meats and seafood; dairy products; beverage products; imported specialties; and fresh produce. It also supplies various non-food items, including paper products comprising disposable napkins, plates, and cups; tableware consisting of China and silverware; cookware, which include pots, pans, and utensils; restaurant and kitchen equipment and supplies; and cleaning supplies. The company serves restaurants, hospitals and nursing homes, schools and colleges, hotels and motels, industrial caterers, and other foodservice venues. As of August 27, 2021, it operated 343 distribution facilities. Sysco Corporation was incorporated in 1969 and is headquartered in Houston, Texas.","Daxor Corporation, a medical device company, provides blood volume measurement technology focused on blood volume testing. The company develops and markets BVA-100 Blood Volume Analyzer, a diagnostic blood test to provide safe, accurate, objective quantification of blood volume status and composition compared to patient-specific norms for used in a broad range of medical and surgical conditions. The company was formerly known as Idant Corporation and changed its name to Daxor Corporation in May 1973. Daxor Corporation was incorporated in 1971 and is headquartered in Oak Ridge, Tennessee.","DoubleDown Interactive Co., Ltd. engages in the development and publishing of digital games on mobile and web-based platforms for casual players in South Korea. The company offers DoubleDown Casino, DoubleDown Classic, DoubleDown Fort Knox, and Undead World: Hero Survival games. Its games are primarily distributed, marketed, and promoted through third party platform providers. The company was formerly known as The8Games Co., Ltd. and changed its name to DoubleDown Interactive Co., Ltd. in December 2019. The company was incorporated in 2008 and is headquartered in Seoul, South Korea. DoubleDown Interactive Co., Ltd. operates as a subsidiary of DoubleU Games Co., Ltd.","First US Bancshares, Inc. operates as the bank holding company for First US Bank that provides commercial banking products and services. The company offers non-interest-bearing demand deposits, savings accounts, NOW accounts, money market demand accounts, individual retirement accounts, and time deposits. Its loan products include commercial construction, land, and land development loans comprising residential housing, commercial and industrial use property development loans, raw land purchase and improvement loans, and agricultural production loans; mortgage loans on residential properties and apartment buildings; real estate loans secured by commercial and industrial properties, office or mixed-use facilities, strip shopping centers, or other commercial property; loans and leases to commercial customers; and secured and unsecured personal loans, including automobile loans and other direct consumer installment loans. The company also provides loans secured by personal property items, such as furniture, ATVs, and home appliances, as well as recreational vehicles, boats, and cargo trailers. In addition, it provides letters of credit; and safe deposit box and remote deposit capture services, as well as underwrites credit life, and credit accident and health insurance reinsurance policies. The company serves small-and medium-sized businesses, property managers, business executives, professionals, and other individuals. It operates 15 full-service banking offices in Birmingham, Butler, Calera, Centreville, Gilbertown, Grove Hill, Harpersville, Jackson, Thomasville, Tuscaloosa, and Woodstock, Alabama; Knoxville and Powell, Tennessee; and Rose Hill, Virginia, as well as loan production offices in Mobile, Alabama, and the Chattanooga, Tennessee area. The company was formerly known as United Security Bancshares, Inc. and changed its name to First US Bancshares, Inc. in October 2016. First US Bancshares, Inc. was founded in 1952 and is headquartered in Birmingham, Alabama.","Great Elm Capital Corp. is a business development company which specializes in loan and mezzanine, middle market investments. It invests in the debt instruments of middle market companies. The fund prefers to invest in media, commercial services and supplies, healthcare, telecommunication services, communications equipment. It typically makes equity investments between $3 million and $10 million in companies with revenues between $3 million and $75 million.","Euroseas Ltd. provides ocean-going transportation services worldwide. The company owns and operates containerships that transport dry and refrigerated containerized cargoes, including manufactured products and perishables. As of May 03, 2022, it had a fleet of 18 vessels, including 10 feeder and 8 intermediate containerships with a cargo capacity of approximately 58,871 twenty-foot equivalent unit (teu). The company was incorporated in 2005 and is based in Marousi, Greece.","Celsius Holdings, Inc. develops, processes, markets, distributes, and sells functional drinks and liquid supplements in North America, Europe, Asia, and internationally. It offers various carbonated and non-carbonated functional energy drinks under the CELSIUS Originals name; dietary supplement in carbonated flavors, including apple jack'd, orangesicle, inferno punch, cherry lime, blueberry pomegranate, strawberry dragon fruit, tangerine grapefruit, and jackfruit under the CELSIUS HEAT name; and branched-chain amino acids functional energy drink that fuels muscle recovery under the CELSIUS BCCA+ENERGY name. The company also provides CELSIUS On-the-Go, a powdered form of the active ingredients in functional energy drinks in individual On-The-Go packets and canisters; and sparkling grapefruit, cucumber lime, and orange pomegranate, as well as pineapple coconut, watermelon berry, and strawberries and cream non-carbonated functional energy drinks under the CELSIUS Sweetened. It distributes its products through direct-to-store delivery distributors and direct to retailers, including supermarkets, convenience stores, drug stores, nutritional stores, and mass merchants, as well as health clubs, spas, gyms, the military, and e-commerce websites. The company was formerly known as Vector Ventures, Inc. and changed its name to Celsius Holdings, Inc. in January 2007. Celsius Holdings, Inc. was founded in 2004 and is headquartered in Boca Raton, Florida.","AppLovin Corporation engages in building a software-based platform for mobile app developers to enhance the marketing and monetization of their apps in the United States and internationally. The company's software solutions include AppDiscovery, a marketing software solution, which matches advertiser demand with publisher supply through auctions; Adjust, an analytics platform that helps marketers grow their mobile apps with solutions for measuring, optimizing campaigns, and protecting user data; and MAX, an in-app bidding software that optimizes the value of an app's advertising inventory by running a real-time competitive auction. Its business clients include various advertisers, publishers, internet platforms, and others. The company was incorporated in 2011 and is headquartered in Palo Alto, California.","Tesla, Inc. designs, develops, manufactures, leases, and sells electric vehicles, and energy generation and storage systems in the United States, China, and internationally. It operates in two segments, Automotive, and Energy Generation and Storage. The Automotive segment offers electric vehicles, as well as sells automotive regulatory credits; and non-warranty after-sales vehicle, used vehicles, retail merchandise, and vehicle insurance services. This segment also provides sedans and sport utility vehicles through direct and used vehicle sales, a network of Tesla Superchargers, and in-app upgrades; purchase financing and leasing services; services for electric vehicles through its company-owned service locations and Tesla mobile service technicians; and vehicle limited warranties and extended service plans. The Energy Generation and Storage segment engages in the design, manufacture, installation, sale, and leasing of solar energy generation and energy storage products, and related services to residential, commercial, and industrial customers and utilities through its website, stores, and galleries, as well as through a network of channel partners; and provision of service and repairs to its energy product customers, including under warranty, as well as various financing options to its solar customers. The company was formerly known as Tesla Motors, Inc. and changed its name to Tesla, Inc. in February 2017. Tesla, Inc. was incorporated in 2003 and is headquartered in Austin, Texas.","A-Mark Precious Metals, Inc., together with its subsidiaries, operates as a precious metals trading company. It operates in three segments: Wholesale Sales &amp; Ancillary Services, Direct-to-Consumer, and Secured Lending. The Wholesale Sales &amp; Ancillary Services segment sells gold, silver, platinum, and palladium in the form of bars, plates, powders, wafers, grains, ingots, and coins. This segment also offers various ancillary services, including financing, storage, consignment, logistics, and various customized financial programs; and designs and produces minted silver products. The Direct-to-Consumer segment provides access to an array of gold, silver, copper, platinum, and palladium products through its websites and marketplaces. It operates five company-owned websites targeting specific niches within the precious metals retail market. This segment also operates as a direct retailer of precious metals to the investor community and markets its precious metal products on television, radio, and the internet, as well as through customer service outreach. The Secured Lending segment originates and acquires commercial loans secured by bullion and numismatic coins; and serves coin and precious metal dealers, investors, and collectors. The company serves customers, including financial institutions, bullion retailers, industrial manufacturers and fabricators, sovereign mints, refiners, coin and metal dealers, investors, collectors, and e-commerce and other retail customers. It has operations in the United States, rest of North America, Europe, the Asia Pacific, Africa, and Australia. A-Mark Precious Metals, Inc. was founded in 1965 and is headquartered in El Segundo, California.","Aehr Test Systems provides test systems for burning-in and testing logic, optical, and memory integrated circuits worldwide. It offers products, such as the ABTS and FOX-P families of test and burn-in systems and FOX WaferPak Aligner, FOX-XP WaferPak Contactor, FOX DiePak Carrier, and FOX DiePak Loader. The ABTS system is used in production and qualification testing of packaged parts for lower power and higher power logic devices, as well as various common types of memory devices. The FOX-XP and FOX-NP systems are wafer contact and singulated die/module test and burn-in systems used for burn-in and functional test of complex devices, such as memories, digital signal processors, microprocessors, microcontrollers, systems-on-a-chip, and integrated optical devices. The FOX-CP system is a single-wafer compact test and reliability verification solution for logic, memory, and photonic devices. The WaferPak Contactor contains a unique full wafer probe card capable of testing wafers up to 300mm that enables IC manufacturers to perform test and burn-in of full wafers on Aehr Test FOX systems. The DiePak Carrier is a reusable, temporary package that enables IC manufacturers to perform final test and burn-in of bare die and modules. Aehr Test Systems was incorporated in 1977 and is headquartered in Fremont, California.","Daktronics, Inc. designs, manufactures, markets, and sells electronic display systems and related products worldwide. It operates through five segments: Commercial, Live Events, High School Park and Recreation, Transportation, and International. The company offers video display systems, such as displays to show various levels of video, graphics, and animation; indoor and outdoor light emitting diodes (LED) video displays, including centerhung, landmark, ribbon board, and corporate office entrance displays, as well as video walls and hanging banners; mobile and modular display systems; architectural lighting and display products; indoor and outdoor scoreboards for various sports, digit displays, scoring and timing controllers, statistics software, and other related products; and timing systems for sports events primarily aquatics and track competitions, as well as swimming touchpads, race start systems, and relay take-off platforms. It also provides control components for video displays in live event applications; message displays; ITS dynamic message signs, including LED displays for road management; mass transit displays; and sound systems for indoor and outdoor sports venues. In addition, the company offers out-of-home advertising displays comprising digital billboards and street furniture displays; DataTime product line that consists of outdoor time and temperature displays; and Fuelight digit displays designed for the petroleum industry. Further, it provides ADFLOW DMS systems that include indoor networked solutions for retailers, convenience stores, and other businesses; and Venus Control Suite, Show Control, Vanguard, and others, as well as maintenance and professional services related to its products. The company sells its products through direct sales and resellers. Daktronics, Inc. was founded in 1968 and is headquartered in Brookings, South Dakota.","Extreme Networks, Inc. provides software-driven networking solutions worldwide. It designs, develops, and manufactures wired and wireless network infrastructure equipment; and develops software for network management, policy, analytics, security, and access controls. The company offers ExtremeCloud IQ, an ML/AI powered, wired, and wireless cloud network management solution that offers advanced visibility and control over users, devices, and applications; ExtremeCloud IQ \u0096 Site Engine that provides task automation, access control, granular visibility with real-time analytics and multi-vendor device management; and ExtremeCloud IQ Essentials offers WIPS, location services, IoT, and guest management services. It also provides wireless access point products; ExtremeSwitching portfolio that includes access edge products that offer physical presentations along with options to deliver Ethernet or convergence-friendly Power-over-Ethernet (POE), including high-power universal POE; aggregation/core switches designed to address aggregation, top-of-rack, and campus core environments; and data center switches and routers. In addition, the company offers cloud native platforms and applications for service providers; and customer support and services. It markets and sells its products through distributors, resellers, and field sales organizations to healthcare, education, government, manufacturing, retail, and hospitality markets. Extreme Networks, Inc. was incorporated in 1996 and is headquartered in Morrisville, North Carolina.","The Vita Coco Company, Inc. develops, markets, and distributes coconut water products under the Vita Coco brand name in the United States, Canada, Europe, the Middle East, and the Asia Pacific. The company offers coconut oil and coconut milk; Hydration Drink Mix, a powdered form of flavored coconut water; sparkling water; Runa, a plant-based energy drink; purified water under the Ever &amp; Ever brand name; and PWR LIFT, a protein-infused fitness drink. It distributes its products through club, food, drug, mass, convenience, e-commerce, and foodservice channels. In addition, the company supplies coconut water and coconut oil categories to retailers. The company was formerly known as All Market Inc. and changed its name to The Vita Coco Company, Inc. in September 2021.The Vita Coco Company, Inc. was founded in 2004 and is headquartered in New York, New York.","Bruker Corporation develops, manufactures, and distributes scientific instruments, and analytical and diagnostic solutions in the United States and internationally. The company operates through three segments: Bruker Scientific Instruments (BSI) Life Science, BSI NANO, and Bruker Energy &amp; Supercon Technologies. It offers life science tools, and single and multiple modality systems; life science mass spectrometry; MALDI Biotyper rapid pathogen identification platform and related test kits, DNA test strips, and fluorescence-based polymerase chain reaction technology; genotype and fluorotype molecular diagnostics kits; research, analytical, and process analysis instruments and solutions; SARS-CoV 2 testing for the diagnosis of COVID-19 infection; and Fluorotyper-SARS-CoV 2 plus kits. It also provides range of portable analytical and bioanalytical detection systems, and related products; X-ray instruments; analytical tools for electron microscopes, as well as handheld, portable, and mobile X-ray fluorescence spectrometry instruments; atomic force microscopy instrumentation; non-contact nanometer resolution solution topography; and automated X-ray metrology, automated AFM defect-detection, and photomask repair and cleaning equipment. In addition, the company offers advanced optical fluorescence microscopy instruments; products and services to support the multi-omics needs of researchers in translational research, drug, and biomarker discovery; superconducting materials, such as metallic low temperature superconductors; devices and complex tools based on metallic low temperature superconductors; and non-superconducting high technology tools, such as synchrotron and beamline instrumentation. Bruker Corporation has a collaboration with Newomics Inc. on a LC-MS platform for drug discovery. The company was incorporated in 1991 and is headquartered in Billerica, Massachusetts.","Avis Budget Group, Inc., together with its subsidiaries, provides car and truck rentals, car sharing, and ancillary products and services to businesses and consumers. It operates the Avis brand, that offers vehicle rental and other mobility solutions to the premium commercial and leisure segments of the travel industry; the Budget Truck brand, a local, and one-way truck and cargo van rental businesses with a fleet of approximately 20,000 vehicles, which are rented through a network of approximately 465 dealer-operated and 385 company-operated locations that serve the consumer and light commercial sectors in the continental United States; and the Zipcar brand, a car sharing network. The company also operates various other car rental brands, such as Budget, Payless, Apex, Maggiore, MoriniRent, FranceCars, Amicoblue, Turiscar, and ACL Hire. In addition, it offers optional insurance products and coverages, such as supplemental liability, personal accident, personal effects protection, emergency sickness protection, and automobile towing protection and cargo insurance products; fuel service options, roadside assistance services, electronic toll collection services, curbside delivery, tablet rentals, access to satellite radio, portable navigation units, and child safety seat rentals; automobile towing equipment and other moving accessories, such as hand trucks, furniture pads, and moving supplies; and Business Intelligence solution, an online portal for corporate travel. Avis Budget Group, Inc. operates in approximately 10,400 locations worldwide. The company was formerly known as Cendant Corporation and changed its name to Avis Budget Group, Inc. in September 2006. Avis Budget Group, Inc. was founded in 1946 and is headquartered in Parsippany, New Jersey.","Eltek Ltd. manufactures, markets, and sells printed circuit boards (PCBs) in Israel, Europe, North America, India, the Netherlands, and internationally. The company offers a range of custom designed PCBs, including rigid, double-sided, and multi-layer PCBs, and flexible circuitry boards. It also offers high density interconnect, flex-rigid, and multi-layered boards. It primarily serves manufacturers of defense and aerospace, medical, industrial, telecom, and networking equipment, as well as contract electronic manufacturers and others. The company markets and sells its products primarily through direct sales personnel, sales representatives, and PCB trading and manufacturing companies. Eltek Ltd. was incorporated in 1970 and is headquartered in Petach Tikva, Israel. Eltek Ltd. is a subsidiary of Nistec Golan Ltd.","Esquire Financial Holdings, Inc. operates as the bank holding company for Esquire Bank, National Association that provides commercial banking products and services to legal industry and small businesses, and commercial and retail customers in the United States. The company offers checking, savings, money market, and time deposits, as well as certificates of deposit. It also provides commercial loans, including short-term financing for inventory, receivables, the purchase of supplies, or other operating needs arising during the normal course of business, as well as loans to its qualified merchant customers; commercial lines of credit; consumer loans consisting of post-settlement consumer and structured settlement loans to plaintiffs and claimants, as well as loans to individuals for debt consolidation, medical expenses, living expenses, payment of outstanding bills, or other consumer needs; and real estate loans, such as multifamily, 1-4 family residential, commercial real estate, and construction loans, as well as merchant services. As of January 25, 2022, the company operated a full-service branch in Jericho, New York; and an administrative office in Boca Raton, Florida. Esquire Financial Holdings, Inc. was founded in 2006 and is headquartered in Jericho, New York.","Apple Inc. designs, manufactures, and markets smartphones, personal computers, tablets, wearables, and accessories worldwide. The company offers iPhone, a line of smartphones; Mac, a line of personal computers; iPad, a line of multi-purpose tablets; and wearables, home, and accessories comprising AirPods, Apple TV, Apple Watch, Beats products, and HomePod. It also provides AppleCare support and cloud services; and operates various platforms, including the App Store that allow customers to discover and download applications and digital content, such as books, music, video, games, and podcasts. In addition, the company offers various services, such as Apple Arcade, a game subscription service; Apple Fitness+, a personalized fitness service; Apple Music, which offers users a curated listening experience with on-demand radio stations; Apple News+, a subscription news and magazine service; Apple TV+, which offers exclusive original content; Apple Card, a co-branded credit card; and Apple Pay, a cashless payment service, as well as licenses its intellectual property. The company serves consumers, and small and mid-sized businesses; and the education, enterprise, and government markets. It distributes third-party applications for its products through the App Store. The company also sells its products through its retail and online stores, and direct sales force; and third-party cellular network carriers, wholesalers, retailers, and resellers. Apple Inc. was incorporated in 1977 and is headquartered in Cupertino, California.","Synopsys, Inc. provides electronic design automation software products used to design and test integrated circuits. The company offers Fusion Design Platform that provides digital design implementation solutions; Verification Continuum Platform that provides virtual prototyping, static and formal verification, simulation, emulation, field programmable gate array (FPGA)-based prototyping, and debug solutions; and FPGA design products that are programmed to perform specific functions. It also provides intellectual property (IP) solutions for USB, PCI Express, DDR, Ethernet, SATA, MIPI, HDMI, and Bluetooth low energy applications; analog IP, including data converters and audio codecs; and system-on-chip (SoC) infrastructure IP, datapath and building block IP, and verification IP products, as well as mathematical and floating-point components, and Arm AMBA interconnect fabric and peripherals. In addition, the company offers logic libraries and embedded memories; configurable processor cores and application-specific instruction-set processor tools for embedded applications; IP subsystems for audio, sensor, and data fusion functionality; and security IP solutions. Further, it provides Platform Architect solutions for SoC architecture analysis and optimization; virtual prototyping solutions; and HAPS FPGA-based prototyping systems, as well as a series of tools used in the design of optical systems and photonic devices. Additionally, the company offers security testing, managed services, programs and professional services, and training that enable its customers to detect and remediate security vulnerabilities, and defects in the software development lifecycle, as well as manufacturing solutions. It serves electronics, financial services, automotive, medicine, energy, and industrial areas. The company was incorporated in 1986 and is headquartered in Mountain View, California.","United Rentals, Inc., through its subsidiaries, operates as an equipment rental company. It operates in two segments, General Rentals and Specialty. The General Rentals segment rents general construction and industrial equipment includes backhoes, skid-steer loaders, forklifts, earthmoving equipment, and material handling equipment; aerial work platforms, such as boom and scissor lifts; and general tools and light equipment comprising pressure washers, water pumps, and power tools for construction and industrial companies, manufacturers, utilities, municipalities, homeowners, and government entities. The specialty segment rents specialty construction products, including trench safety equipment consists of trench shields, aluminum hydraulic shoring systems, slide rails, crossing plates, construction lasers, and line testing equipment for underground work; power and heating, ventilating, and air conditioning equipment, such as portable diesel generators, electrical distribution equipment, and temperature control equipment; fluid solutions equipment for fluid containment, transfer, and treatment; and mobile storage equipment and modular office space. This segment serves construction companies involved in infrastructure projects, and municipalities and industrial companies. It also sells aerial lifts, reach forklifts, telehandlers, compressors, and generators; construction consumables, tools, small equipment, and safety supplies; and parts for equipment that is owned by its customers, as well as provides repair and maintenance services. The company sells used equipment through its sales force, brokers, website, directly to manufacturers, and at auctions. The company operates a network of 1,360 rental locations in the United States, Canada, Europe, Australia, and New Zealand. United Rentals, Inc. was incorporated in 1997 and is headquartered in Stamford, Connecticut.","Accenture plc, a professional services company, provides strategy and consulting, interactive, and technology and operations services worldwide. The company offers application services, including agile transformation, DevOps, application modernization, enterprise architecture, software and quality engineering, data management, intelligent automation comprises robotic process automation, natural language processing, and virtual agents, and liquid application management services, as well as program, project, and service management services; strategy consulting services; critical data elements, data management and governance, data platform and architecture, product-based organization and skills, business adoption, and value realization services; engineering, and research and development digitization; smart connected product design and development; product platform engineering and modernization; product as-a-service enablement; products related to production and operations; autonomous robotics systems; the digital transformation of capital projects; and digital industrial workforce solutions. It also provides data-enabled operating models; technology consulting and artificial intelligence services; services related to talent and organization/human potential; digital commerce; infrastructure services, such as hybrid cloud, network, digital workplace and collaboration, service and experience management, infrastructure as code, and managed edge and IoT devices; cyber defense, applied cybersecurity, managed security, OT security, security strategy and risk, and industry security products; services related to technology innovation; and intelligent automation services. In addition, the company offers cloud, ecosystem, marketing, supply chain management, zero-based budgeting, customer experience, finance consulting, mergers and acquisitions, and sustainability services. Accenture plc was founded in 1951 and is based in Dublin, Ireland.","Cresud Sociedad An\u00f3nima Comercial, Inmobiliaria, Financiera y Agropecuaria, an agricultural company, produces basic agricultural commodities in Brazil and other Latin American countries. It operates through Agricultural Business, and Urban Properties and Investment Business segments. The Agricultural Business segment is involved in the planting, harvesting, and sale of crops, such as wheat, corn, soybeans, cotton, and sunflower, as well as sugarcane; sale of grain derivatives, including flour and oil; breeding, purchasing, and/or fattening of cattle for sale to meat processors and local livestock auction markets; provision of agricultural services; leasing of farms to third parties; disposal and development of farmlands; and brokerage activities. The Urban Properties and Investment Business segment leases, rents, and services commercial and other spaces in shopping malls; leases offices and other rental spaces; develops, maintains, and sells undeveloped parcels of land and/or trading properties; and operates hotels, as well as engages in the entertainment activities. The company was incorporated in 1936 and is headquartered in Buenos Aires, Argentina.","Five Below, Inc. operates as a specialty value retailer in the United States. It offers accessories, including socks, sunglasses, jewelry, scarves, gloves, hair accessories, athletic tops and bottoms, and t-shirts, as well as nail polishes, lip glosses, fragrances, and branded cosmetics; and items used to complete and personalize living space, such as glitter lamps, posters, frames, fleece blankets, plush items, pillows, candles, incense, lighting, novelty d\u00e9cor, accent furniture, and related items, as well as provides storage options for the customers room. The company also provides sport balls; team sports merchandise and fitness accessories, such as hand weights, jump ropes, and gym balls; games, including name brand board games, puzzles, collectibles, and toys covering remote control; and pool, beach, and outdoor toys, as well as games and accessories. In addition, it offers accessories for cell phones, tablets, audio, and computers, such as cases, chargers, headphones, and other items; books, video games, and DVDs; craft activity kits; arts and crafts supplies, such as crayons, markers, and stickers; and trend-right items for school comprising backpacks, fashion notebooks and journals, novelty pens and pencils, locker accessories, and everyday name brand items. Further, the company provides party goods, decorations, gag gifts, and greeting cards, as well as every day and special occasion merchandise products; assortment of classic and novelty candy bars, movie-size box candy, seasonal-related candy, and gum and snack food; chilled drinks through coolers; and seasonally-specific items used to celebrate and decorate for events. It primarily serves tween and teen customers. As of January 29, 2022, the company operated approximately 1,190 stores in 40 states. The company was formerly known as Cheap Holdings, Inc. and changed its name to Five Below, Inc. in August 2002. Five Below, Inc. was incorporated in 2002 and is headquartered in Philadelphia, Pennsylvania.","Allegro MicroSystems, Inc. designs, develops, manufactures, and markets sensor integrated circuits (ICs) and application-specific analog power ICs for motion control and energy-efficient systems. Its products include magnetic sensor ICs, such as position, speed, and current sensor ICs; power ICs comprising motor driver ICs, and regulator and LED driver ICs; and photonic and 3D sensing components, including photodiodes, eye-safe lasers, and readout ICs for LiDAR applications. The company sells its products to original equipment manufacturers and suppliers primarily in the automotive and industrial markets through its direct sales force, third party distributors, independent sales representatives, and consignment. It operates in the United States, rest of the Americas, Europe, Japan, Greater China, South Korea, and other Asian markets. The company was founded in 1990 and is headquartered in Manchester, New Hampshire. Allegro MicroSystems, Inc. is a subsidiary of Sanken Electric Co., Ltd.","Cavco Industries, Inc. designs, produces, and retails manufactured homes primarily in the United States. It operates in two segments, Factory-Built Housing and Financial Services. The company markets its manufactured homes under the Cavco, Fleetwood, Palm Harbor, Nationwide, Fairmont, Friendship, Chariot Eagle, Destiny, Commodore, Colony, Pennwest, R-Anell, Manorwood, and MidCountry brands. It also builds park model RVs; vacation cabins; and factory-built commercial structures, including apartment buildings, condominiums, hotels, workforce housing, schools, and housing for the United States military troops. In addition, the company produces various modular homes, which include single and multi-section ranch, split-level, and Cape Cod style homes, as well as two- and three-story homes, and multi-family units. Further, it provides conforming and non-conforming mortgages and home-only loans to purchasers of various brands of factory-built homes sold by company-owned retail stores, as well as various independent distributors, builders, communities, and developers. Additionally, the company offers property and casualty insurance to owners of manufactured homes. As of April 3, 2022, it operated 45 company-owned retail stores in Oregon, Arizona, Nevada, New Mexico, Texas, Indiana, Oklahoma, Florida, and New York. The company also distributes its homes through a network of independent distribution points in 48 states and Canada; and through planned community operators and residential developers. Cavco Industries, Inc. was founded in 1965 and is headquartered in Phoenix, Arizona.","Concrete Pumping Holdings, Inc. provides concrete pumping and waste management services in the United States and the United Kingdom. The company offers concrete pumping services to general contractors and concrete finishing companies in the commercial, infrastructure, and residential sectors under the Brundage-Bone and Camfaud brands; and industrial cleanup and containment services primarily to customers in the construction industry under the Eco-Pan brand. It also leases and rents concrete pumping equipment, pans, and containers. As of October 31, 2021, the company owned a fleet of approximately 820 boom pumps, 70 placing booms, 20 telebelts, 250 stationary pumps, and 90 waste management trucks. Concrete Pumping Holdings, Inc. was founded in 1983 and is headquartered in Thornton, Colorado.","Chuy's Holdings, Inc., through its subsidiaries, owns and operates full-service restaurants under the Chuy's name in the United States. As of December 26, 2021, it operated 96 restaurants in 17 states, including the Southeastern and Midwestern United States. The company was founded in 1982 and is headquartered in Austin, Texas.","Starbucks Corporation, together with its subsidiaries, operates as a roaster, marketer, and retailer of specialty coffee worldwide. The company operates through three segments: North America, International, and Channel Development. Its stores offer coffee and tea beverages, roasted whole beans and ground coffees, single serve products, and ready-to-drink beverages; and various food products, such as pastries, breakfast sandwiches, and lunch items. The company also licenses its trademarks through licensed stores, and grocery and foodservice accounts. The company offers its products under the Starbucks, Teavana, Seattle's Best Coffee, Evolution Fresh, Ethos, Starbucks Reserve, and Princi brands. As of October 3, 2021, it operated 16,826 company-operated and licensed stores in North America; and 17,007 company-operated and licensed stores internationally. The company was founded in 1971 and is based in Seattle, Washington.","CSG Systems International, Inc. provides revenue management and digital monetization, customer engagement, and payment solutions primarily to the communications industry in the Americas, Europe, the Middle East, Africa, and the Asia Pacific. It offers Advanced Convergent Platform, a private SaaS based platform; related solutions, including field force automation, analytics, electronic bill presentment, ACH, etc. to the North American cable and satellite markets. The company also provides managed services; and professional services to implement, configure, and maintain its solutions, as well as licenses various solutions, such as mediation, partner management, rating, and charging. It serves retail, financial services, healthcare, insurance, and government entities. The company was incorporated in 1994 and is headquartered in Greenwood Village, Colorado.","Adobe Inc. operates as a diversified software company worldwide. It operates through three segments: Digital Media, Digital Experience, and Publishing and Advertising. The Digital Media segment offers products, services, and solutions that enable individuals, teams, and enterprises to create, publish, and promote content; and Document Cloud, a unified cloud-based document services platform. Its flagship product is Creative Cloud, a subscription service that allows members to access its creative products. This segment serves content creators, workers, marketers, educators, enthusiasts, communicators, and consumers. The Digital Experience segment provides an integrated platform and set of applications and services that enable brands and businesses to create, manage, execute, measure, monetize, and optimize customer experiences from analytics to commerce. This segment serves marketers, advertisers, agencies, publishers, merchandisers, merchants, web analysts, data scientists, developers, and executives across the C-suite. The Publishing and Advertising segment offers products and services, such as e-learning solutions, technical document publishing, web conferencing, document and forms platform, web application development, and high-end printing, as well as Advertising Cloud offerings. The company offers its products and services directly to enterprise customers through its sales force and local field offices, as well as to end users through app stores and through its website at adobe.com. It also distributes products and services through a network of distributors, value-added resellers, systems integrators, software vendors and developers, retailers, and original equipment manufacturers. The company was formerly known as Adobe Systems Incorporated and changed its name to Adobe Inc. in October 2018. Adobe Inc. was founded in 1982 and is headquartered in San Jose, California.","Diamond Hill Investment Group, Inc., through its subsidiary, Diamond Hill Capital Management, Inc., provides investment advisory and fund administration services in the United States. It sponsors, distributes, and offers investment advisory and related services to its clients through pooled investment vehicles, including the Diamond Hill Funds, separately managed accounts, and model delivery programs. The company also provides fund administration services, including portfolio and regulatory compliance, treasury and financial oversight, and general business management and governance of the mutual fund complex, as well as oversight of back-office service providers, such as the custodian, fund accountant, and transfer agent. The company was founded in 1990 and is based in Columbus, Ohio.","Autodesk, Inc. provides 3D design, engineering, and entertainment software and services worldwide. The company offers AutoCAD Civil 3D, a surveying, design, analysis, and documentation solution for civil engineering, including land development, transportation, and environmental projects; BIM 360, a construction management cloud-based software; AutoCAD, a software for professional design, drafting, detailing, and visualization; AutoCAD LT, a drafting and detailing software; computer-aided manufacturing (CAM) software for computer numeric control machining, inspection, and modelling for manufacturing; Fusion 360, a 3D CAD, CAM, and computer-aided engineering tool; and Industry Collections tools for professionals in architecture, engineering and construction, product design and manufacturing, and media and entertainment collection industries. It also provides Inventor tools for 3D mechanical design, simulation, analysis, tooling, visualization, and documentation; Vault, a data management software to manage data in one central location, accelerate design processes, and streamline internal/external collaboration; Maya and 3ds Max software products that offer 3D modeling, animation, effects, rendering, and compositing solutions; and ShotGrid, a cloud-based software for review and production tracking in the media and entertainment industry. It sells its products and services to customers directly, as well as through a network of resellers and distributors. Autodesk, Inc. was incorporated in 1982 and is headquartered in San Rafael, California.","Diodes Incorporated designs, manufactures, and supplies application-specific standard products in the discrete, logic, analog, and mixed-signal semiconductor markets worldwide. It focuses on low pin count semiconductor devices with one or more active or passive components. The company offers discrete semiconductor products, such as MOSFET, TVS, and performance Schottky rectifiers; GPP bridges and retifiers, and performance Schottky diodes; Zener and performance Zener diodes, including tight tolerance and low operating current type; standard, fast, super-fast, and ultra-fast recovery rectifiers; bridge rectifiers; switching diodes; small signal bipolar and prebiased transistors; thyristor surge protection devices; and transient voltage suppressors. It also provides analog products, such as power management devices comprising AC-DC and DC-DC converters, USB power switches, and low dropout and linear voltage regulators; linear devices, such as operational amplifiers and comparators, current monitors, voltage references, and reset generators; LED lighting drivers; audio amplifiers; and sensor products, including hall-effect sensors and motor drivers. The company offers mixed-signal products, such as high speed mux/demux products, digital switches, interfaces, redrivers, universal level shifters/voltage translator, clock ICs, and packet switches; standard logic products comprising low-voltage complementary metal\u0096oxide\u0096semiconductor (CMOS) and high-speed CMOS devices; ultra-low power CMOS logic products and analog switches; multichip products and co-packaged discrete, analog, and mixed-signal silicon in miniature packages; silicon and silicon epitaxial wafers; and crystals and oscillators. It sells its products to the consumer electronics, computing, communications, industrial, and automotive markets through direct sales, marketing personnel, independent sales representatives, and distributors. The company was incorporated in 1959 and is headquartered in Plano, Texas.","Skyworks Solutions, Inc., together with its subsidiaries, designs, develops, manufactures, and markets proprietary semiconductor products, including intellectual property in the United States, China, South Korea, Taiwan, Europe, the Middle East, Africa, and rest of Asia-Pacific. Its product portfolio includes amplifiers, antenna tuners, attenuators, automotive tuners and digital radios, circulators/isolators, DC/DC converters, demodulators, detectors, diodes, wireless analog system on chip products, directional couplers, diversity receive modules, filters, front-end modules, hybrids, light emitting diode drivers, low noise amplifiers, mixers, modulators, optocouplers/optoisolators, phase locked loops, phase shifters, power dividers/combiners, receivers, switches, synthesizers, timing devices, technical ceramics, voltage controlled oscillators/synthesizers, and voltage regulators. The company provides its products for use in the aerospace, automotive, broadband, cellular infrastructure, connected home, entertainment and gaming, industrial, medical, military, smartphone, tablet, and wearable markets. It sells its products through direct sales force, electronic component distributors, and independent sales representatives. The company was incorporated in 1962 and is headquartered in Irvine, California.","Cisco Systems, Inc. designs, manufactures, and sells Internet Protocol based networking and other products related to the communications and information technology industry in the Americas, Europe, the Middle East, Africa, the Asia Pacific, Japan, and China. It provides infrastructure platforms, including networking technologies of switching, routing, wireless, and data center products that are designed to work together to deliver networking capabilities, and transport and/or store data. The company also offers collaboration products comprising unified communications, Cisco TelePresence, and conferencing, as well as the Internet of Things and analytics software. In addition, it provides security products, such as network security, cloud and email security, identity and access management, advanced threat protection, and unified threat management products. Further, the company offers a range of service and support options for its customers, including technical support and advanced services. It serves businesses of various sizes, public institutions, governments, and service providers. The company sells its products and services directly, as well as through systems integrators, service providers, other resellers, and distributors. Cisco Systems, Inc. has strategic alliances with other companies. Cisco Systems, Inc. was incorporated in 1984 and is headquartered in San Jose, California.","Rockwell Automation, Inc. provides industrial automation and digital transformation solutions in the United States and internationally. The company operates in three segments, Intelligent Devices, Software &amp; Control, and Lifecycle Services. Its solutions include hardware and software products, and services. The Intelligent Devices segment offers drives, motion, safety, sensing, industrial components, and configured-to-order products. The Software &amp; Control segment provides control and visualization software and hardware, information software, digital twin and simulation software, and network and security infrastructure solutions. The Lifecycle Services segment provides consulting, professional services and solutions, and connected and maintenance services. The company sells its solutions primarily through independent distributors in relation with its direct sales force. It serves discrete end markets, including automotive, semiconductor, warehousing and logistics, and other discrete markets, as well as general industries comprising printing and publishing, marine, glass, fiber and textiles, airports, and aerospace; hybrid end markets, such as food and beverage, life sciences, household and personal care, and tire, as well as eco industrial, including water/wastewater, waste management, mass transit, and renewable energy; and process end markets comprising oil and gas, mining, metals, chemicals, pulp and paper, and others. Rockwell Automation, Inc. was founded in 1903 and is headquartered in Milwaukee, Wisconsin.","FactSet Research Systems Inc., a financial data and analytics company, provides integrated financial information and analytical applications to the investment community in the Americas, Europe, the Middle East, Africa, and the Asia Pacific. The company delivers insight and information through the workflow solutions of research, analytics and trading, content and technology solutions, and wealth. It serves portfolio managers, investment banks, asset managers, wealth advisors, corporate clients, and other financial services entities. FactSet Research Systems Inc. was founded in 1978 and is headquartered in Norwalk, Connecticut.","ResMed Inc. develops, manufactures, distributes, and markets medical devices and cloud-based software applications for the healthcare markets. The company operates in two segments, Sleep and Respiratory Care, and Software as a Service. It offers various products and solutions for a range of respiratory disorders, including technologies to be applied in medical and consumer products, ventilation devices, diagnostic products, mask systems for use in the hospital and home, headgear and other accessories, dental devices, and cloud-based software informatics solutions to manage patient outcomes, as well as provides customer and business processes. The company also provides AirView, a cloud-based system that enables remote monitoring and changing of patients' device settings; myAir, a personalized therapy management application for patients with sleep apnea that provides support, education, and troubleshooting tools for increased patient engagement and improved compliance; U-Sleep, a compliance monitoring solution that enables home medical equipment (HME)to streamline their sleep programs; connectivity module and propeller solutions; and Propeller portal. It offers out-of-hospital software solution, such as Brightree business management software and service solutions to providers of HME, pharmacy, home infusion, orthotics, and prosthetics services; MatrixCare care management and related ancillary solutions to senior living, skilled nursing, life plan communities, home health, home care, and hospice organizations, as well as related accountable care organizations; and HEALTHCAREfirst that offers electronic health record, software, billing and coding services, and analytics for home health and hospice agencies. The company markets its products primarily to sleep clinics, home healthcare dealers, and hospitals through a network of distributors and direct sales force in approximately 140 countries. ResMed Inc. was founded in 1989 and is headquartered in San Diego, California.","DXP Enterprises, Inc., together with its subsidiaries, engages in distributing maintenance, repair, and operating (MRO) products, equipment, and services to the energy and industrial customers primarily in the United States and Canada. It operates through three segments: Service Centers (SC), Supply Chain Services (SCS), and Innovative Pumping Solutions (IPS). The SC segment offers MRO products, equipment, and integrated services, including technical expertise and logistics services. It offers a range of MRO products in the rotating equipment, bearing, power transmission, hose, fluid power, metal working, fastener, industrial supply, safety products, and safety services categories. This segment serves customers in the oil and gas, food and beverage, petrochemical, transportation, other general industrial, mining, construction, chemical, municipal, agriculture, and pulp and paper industries. The SCS segment manages procurement and inventory management solutions; and offers outsourced MRO solutions for sourcing MRO products, including inventory optimization and management, store room management, transaction consolidation and control, vendor oversight and procurement cost optimization, productivity improvement, and customized reporting services. Its programs include SmartAgreement, a procurement solution for various MRO categories; SmartBuy, an on-site or centralized MRO procurement solution; SmartSource, an on-site procurement and storeroom management solution; SmartStore, an e-Catalog solution; SmartVend, an industrial dispensing solution; and SmartServ, an integrated service pump solution. The IPS segment fabricates and assembles custom-made pump packages, remanufactures pumps, and manufactures branded private label pumps. The company was founded in 1908 and is based in Houston, Texas.","Alphatec Holdings, Inc., a medical technology company, designs, develops, and advances technologies for the surgical treatment of spinal disorders. The company offers SafeOp Neural InformatiX System, an Alpha InformatiX product platform designed to reduce the risk of intraoperative nerve injury; Sigma transforaminal lumbar interbody fusion pedicle-based access system that provides direct visualization of anatomical landmarks; Sigma PTP Access and Patient Positioning System; squadron lateral retractor designed to maximize patient outcomes; Invictus Spinal Fixation System, a thoracolumbar fixation system to treat a range of pathologies; and Invictus MIS SingleStep System that provides minimally invasive pedicle screw placement. It also provides Invictus Modular Fixation Systems designed to increase adaptability with the power of screw modularity; OsseoScrew system to restore the integrity of the spinal column; Arsenal spinal fixation system, a comprehensive thoracolumbar fixation platform to fix a range of degenerative to deformity pathologies and surgical procedures; Aspida Anterior Lumbar Plating System, a fixation system for anterior lumbar interbody fusion; AMP Anti-Migration Plate; OCT Spinal Fixation System; trestle luxe anterior cervical plate system; and Insignia Anterior Cervical Plate System. In addition, the company offers IdentiTi Porous Ti, Transcend Lateral, and Battalion Posterior Interbody Implants; and biologics consisting of Cervical Structural Allograft Spacers, 3D ProFuse Demineralized Bone Scaffold, Neocore Osteoconductive Matrix, Alphagraft Demineralized and Cellular Bone Matrix, and Amnioshield Amniotic Tissue Barrier, as well as EOS imaging products. It sells its products through a network of independent distributors and direct sales representatives in the United States. The company was founded in 1990 and is headquartered in Carlsbad, California.","Amcor plc develops, produces, and sells packaging products in Europe, North America, Latin America, Africa, and the Asia Pacific regions. The company operates through two segments, Flexibles and Rigid Packaging. The Flexibles segment provides flexible and film packaging products in the food and beverage, medical and pharmaceutical, fresh produce, snack food, personal care, and other industries. The Rigid Packaging segment offers rigid containers for a range of beverage and food products, including carbonated soft drinks, water, juices, sports drinks, milk-based beverages, spirits and beer, sauces, dressings, spreads, and personal care items; and plastic caps for various applications. The company sells its products primarily through its direct sales force. Amcor plc was incorporated in 2018 and is headquartered in Z\u00fcrich, Switzerland.","Caesarstone Ltd., together with its subsidiaries, develops, manufactures, and markets engineered quartz and other surfaces under the Caesarstone brand in the United States, Australia, Canada, Latin America, Asia, Israel, Europe, the Middle East, and Africa. The company's engineered quartz slabs are primarily used as indoor and outdoor kitchen countertops in the renovation and remodeling construction end markets. Its products are also used in other applications, such as vanity tops, wall panels, back splashes, floor tiles, stairs, furniture, and other interior and exterior surfaces that are used in various residential and non-residential applications. The company also offers porcelain products under the Lioli brand for flooring and cladding applications, as well as resells natural stones, various ancillary fabrication tools, and installation accessories; and sells sinks and materials. It sells its products directly to fabricators, sub-distributors, and resellers; and through direct sales force and indirect network of independent distributors. The company was formerly known as Caesarstone Sdot Yam Ltd. and changed its name to Caesarstone Ltd. in June 2016. Caesarstone Ltd. was founded in 1987 and is headquartered in Menashe, Israel.","Mondelez International, Inc., through its subsidiaries, manufactures, markets, and sells snack food and beverage products in the Latin America, North America, Asia, the Middle East, Africa, and Europe. It provides biscuits, including cookies, crackers, and salted snacks; chocolates; and gums and candies, as well as various cheese and grocery, and powdered beverage products. The company's snack brand portfolio includes Cadbury, Milka, and Toblerone chocolates; Oreo, belVita, and LU biscuits; Halls candies; Trident gums; and Tang powdered beverages. It serves supermarket chains, wholesalers, supercenters, club stores, mass merchandisers, distributors, convenience stores, gasoline stations, drug stores, value stores, and other retail food outlets through direct store delivery, company-owned and satellite warehouses, third party distributors, and other facilities, as well as through independent sales offices and agents, and e-commerce channels. The company was formerly known as Kraft Foods Inc. and changed its name to Mondelez International, Inc. in October 2012. Mondelez International, Inc. was incorporated in 2000 and is headquartered in Chicago, Illinois.","Enterprise Financial Services Corp operates as the financial holding company for Enterprise Bank &amp; Trust that offers banking and wealth management services to individuals and corporate customers. The company offers checking, savings, and money market accounts, and certificates of deposit. It also provides commercial and industrial, commercial real estate, construction and land development, residential real estate, agricultural, and consumer loans. In addition, the company offers treasury management and international trade services; tax credit brokerage services consisting of the acquisition of tax credits and sale of these tax credits to clients; and financial and estate planning, investment management, and trust services to businesses, individuals, institutions, retirement plans, and non-profit organizations. Further, it offers fiduciary, financial advisory, and merchant processing services; and debit and credit cards. Additionally, the company provides international banking, insurance, internet and mobile banking, remote deposit capture, positive pay, fraud detection and prevention, automated payable, check imaging, and statement and document imaging services; and cash management products, controlled disbursements, repurchase agreements, and sweep investment accounts. It operates banking locations and administrative offices in Arizona, California, Kansas, Missouri, Nevada, and New Mexico market areas, as well as a network of SBA loan production offices and deposit production offices in various states. Enterprise Financial Services Corp was founded in 1988 and is headquartered in Clayton, Missouri.","Dropbox, Inc. provides a content collaboration platform worldwide. Its platform allows individuals, families, teams, and organizations to collaborate and sign up for free through its website or app, as well as upgrade to a paid subscription plan for premium features. As of December 31, 2021, the company had approximately 700 million registered users. It serves customers in professional services, technology, media, education, industrial, consumer and retail, and financial services industries. The company was formerly known as Evenflow, Inc. and changed its name to Dropbox, Inc. in October 2009. Dropbox, Inc. was incorporated in 2007 and is headquartered in San Francisco, California.","Eastern Bankshares, Inc. operates as the bank holding company for Eastern Bank that provides banking products and services primarily to retail, commercial, and small business customers. It operates in two segments, Banking Business and Insurance Agency Business. The company provides interest-bearing and non interest-bearing checking deposits, money market deposits, savings deposits, and time certificates of deposits, as well as debit and credit cards. It also offers commercial and industrial loans, commercial real estate and construction loans, small business loans, residential real estate loans, home equity, and lines of credit, as well as other consumer loans comprising unsecured personal lines of credit, overdraft protection, automobile loans, home improvement loans, airplane loans, and other personal loans. In addition, the company provides cash reserves, cash management, merchant, escrow express, government banking, international banking, interest on lawyers trust accounts, retirement planning, and business telephone banking services, as well as products and services for not-for-profit and healthcare. Further, it offers trust and investment products and services; community development and asset-based lending services; financial planning, portfolio management, wealth management, private banking, and fiduciary products; online, mobile, and telephone banking services; and automated lock box collection and account reconciliation services, as well as various insurance products. As of December 31, 2021, the company operated 105 branch offices in eastern Massachusetts and southern New Hampshire; and 23 non-branch offices in eastern Massachusetts, one office in New Hampshire, and one office in Rhode Island. Eastern Bankshares, Inc. was founded in 1818 and is headquartered in Boston, Massachusetts.","Enterprise Bancorp, Inc. operates as the holding company of Enterprise Bank and Trust Company that provides commercial banking products and services. It offers commercial and retail deposit products, including checking accounts, limited-transactional savings and money market accounts, commercial sweep products, and term certificates of deposit. The company also provides commercial real estate, commercial and industrial, commercial construction, residential, and consumer loans, as well as home equity loans and lines of credit. In addition, the company offers cash management services; wealth advisory and management services that include customized investment management and trust services to individuals, family groups, commercial businesses, trusts, foundations, non-profit organizations, and endowments; brokerage and management services to individual investors; insurance services; and voice, online, and mobile banking services. As of January 27, 2022, it had 26 full-service branches located in the Massachusetts communities of Acton, Andover, Billerica, Chelmsford, Dracut, Fitchburg, Lawrence, Leominster, Lexington, Lowell, Methuen, North Andover, Tewksbury, Tyngsborough, and Westford; and in the New Hampshire communities of Derry, Hudson, Nashua, Pelham, Salem, and Windham. The company was founded in 1989 and is headquartered in Lowell, Massachusetts.","ChampionX Corporation provides chemistry solutions, and engineered equipment and technologies to oil and gas companies worldwide. The company's Production Chemical Technologies segment offers onshore and offshore chemical solutions, such as corrosion inhibitors, scale inhibitors, emulsion breakers, and biocides to oil and natural gas production and midstream markets to manage and control corrosion, oil and water separation, flow assurance, sour gas treatment, and water-related issues. The company's Production &amp; Automation Technologies segment provides artificial lift equipment, end-to-end automation and digital solutions, and other production equipment, including electrical submersible pumping systems, gas lift systems, jet pumps, multiplex surface pumps, plunger lift equipment, progressive cavity pumping systems, downhole rod lift systems, emissions monitoring solutions, chemical injection systems, flow control valves, and gauges under the Harbison-Fischer, Norris, Alberta Oil Tool, Oil Lift Technology, PCS Ferguson, Pro-Rod, Upco, Unbridled ESP, Norriseal-Wellmark, Quartzdyne, Spirit, Theta, Timberline, and Windrock brands. The company's Drilling Technologies segment offers polycrystalline diamond cutter inserts, bearings, valves, and mining tools under the US Synthetic brand for use in oil and gas drill bits, renewable energy applications, mixers, and agitators; and high-density ceramic roof bolt mining tools for underground mining operations. The company's Reservoir Chemical Technologies segment provides chemistry-oriented solutions and technologies for well drilling, cementing, fracturing, acidizing, and other well interventions, as well as fracturing fluid packages, drilling and cement additives, and products for acidizing activities. ChampionX Corporation is headquartered in The Woodlands, Texas.","First Capital, Inc. operates as the bank holding company for First Harrison Bank that provides various banking services to individuals and business customers. The company offers various deposit instruments, including non-interest bearing checking accounts, negotiable order of withdrawal accounts, money market accounts, regular savings accounts, certificates of deposit, and retirement savings plans. It also provides real estate mortgage loans, such as fixed-rate and adjustable rate mortgage residential loans, construction loans for residential and commercial properties, and commercial real estate loans, as well as commercial business loans. In addition, the company originates mortgage loans for sale in the secondary market and sells non-deposit investment products; and offers various secured or guaranteed consumer loans comprising automobile and truck loans, home equity loans, home improvement loans, boat loans, mobile home loans, and loans secured by savings deposits, as well as unsecured consumer loans. It provides its products and services through 18 locations in Indiana and Kentucky. First Capital, Inc. was founded in 1891 and is based in Corydon, Indiana.","Aethlon Medical, Inc., a medical technology company, focuses on developing products to diagnose and treat life and organ threatening diseases in the United States. The company develops Aethlon Hemopurifier, a clinical-stage immunotherapeutic device that removes tumor-derived exosomes and life-threatening viruses from the human circulatory system, including removal of COVID-19 virus, associated variants, and related exosomes. Aethlon Medical, Inc. has a collaboration with the University of Pittsburgh Medical Center Hillman Cancer Center for studies related to head and neck cancer. The company was founded in 1999 and is based in San Diego, California.","Cogent Communications Holdings, Inc., through its subsidiaries, provides high-speed Internet access, private network, and data center colocation space services in North America, Europe, Asia, South America, Australia, and Africa. The company offers on-net Internet access and private network services to law firms, financial services firms, and advertising and marketing firms, as well as heath care providers, educational institutions and other professional services businesses, other Internet service providers, telephone companies, cable television companies, Web hosting companies, media service providers, mobile phone operators, content delivery network companies, and commercial content and application service providers. It also provides Internet access and private network services to customers that are not located in buildings directly connected to its network; and on-net services to customers located in buildings that are physically connected to its network. In addition, the company offers off-net services to corporate customers using other carriers' circuits to provide the last mile portion of the link from the customers' premises to the network. Further, it operates data centers that allow its customers to collocate their equipment and access the network. The company operates 54 data centers and provides facilities to 3,035 buildings and on-net services to 1,817 to multi-tenant office buildings. It serves primarily to small and medium-sized businesses, communications service providers, and other bandwidth-intensive organizations. Cogent Communications Holdings, Inc. was founded in 1999 and is headquartered in Washington, the District of Columbia.","Bentley Systems, Incorporated, together with its subsidiaries, provides infrastructure e
